import React,{  useState,useEffect } from 'react'
import { Grid, } from '@material-ui/core';
import Controls from "../components/controls/Controls";
import { useForm, Form } from '../components/useForm';
import axios from "axios";
import configData from "../components/config.json";


const binaryResponse = [
    { id: '1', title: 'Yes' },
    { id: '2', title: 'No' },
]

const phoneTypes = [
    { id: '1', title: 'Landline' },
    { id: '2', title: 'Cell' },
    { id: '3', title: 'Home' },
]
const bestTime = [
    { id: '1', title: 'AM' },
    { id: '2', title: 'PM' },
]

const [stateList, setStateList] = useState([]);

const initialFValues = {
    name_first: '',
    name_middle:'',
    name_last:'',
    dob:'',
    phone1:'',
    phone1_type:'',
    phone1_text_yn:'',
    phone2_yn:'',
    phone2:'',
    phone2_type:'',
    phone2_text_yn:'',
    contact_besttime_survey:'',
    address1:'',
    address2:'',
    city: '',
    state:'',
    zipcode:'',
    voicemail_yn_survey:'',
    copd_yn_survey:'',
    copd_exacerbation_yn_survey:'',
    smoking_yn_survey:'',
    smoking_now_yn_survey:'',
    smoking_start_survey:'',
    smoking_stop_survey:'',
    smoking_amount_survey:'',
    rx_bp_yn_survey:'',
    rx_bp_survey:'',
    recruitment_source_survey:'',
    recruitment_source_other_survey:'',
    current_age:'',
    gender: 'male',
    race:'',
    ethnicity:'',
    email_yn:'',
    email:'',

    departmentId: '',
    hireDate: new Date(),
    isPermanent: false,
}

export default function PatientInfo() {

    const validate = (fieldValues = values) => {
        let temp = { ...errors }
        if ('fullName' in fieldValues)
            temp.fullName = fieldValues.fullName ? "" : "This field is required."
        if ('email' in fieldValues)
            temp.email = (/$^|.+@.+..+/).test(fieldValues.email) ? "" : "Email is not valid."
        if ('mobile' in fieldValues)
            temp.mobile = fieldValues.mobile.length > 9 ? "" : "Minimum 10 numbers required."
        if ('departmentId' in fieldValues)
            temp.departmentId = fieldValues.departmentId.length !== 0 ? "" : "This field is required."
        setErrors({
            ...temp
        })

        if (fieldValues === values)
            return Object.values(temp).every(x => x === "")
    }

    const {
        values,
        errors,
        setErrors,
        handleInputChange,
        resetForm
    } = useForm(initialFValues, true, validate);

    const handleSubmit = e => {
        e.preventDefault()
        if (validate()){
            // employeeService.insertEmployee(values)
            resetForm()
        }
    }

    useEffect(() => {
        axios
                .get(configData.SERVER_URL +"/api/getPlant")
                .then((res) => {
                  console.log(res);
                  setStateList(count + 1)
                });
      });

    return (
        <Form onSubmit={handleSubmit}>
            <Grid container>
                <Grid item xs={4}>
                    <Controls.Input
                        name="firstName"
                        label="First Name"
                        value={values.name_first}
                        onChange={handleInputChange}
                        error={errors.name_first}
                    />

                </Grid>
                <Grid item xs={4}>
                    <Controls.Input
                        name="middleName"
                        label="Middle Name"
                        value={values.name_middle}
                        onChange={handleInputChange}
                        error={errors.name_middle}
                        helptext = "Optional"
                    />

                </Grid>
                <Grid item xs={4}>
                    <Controls.Input
                        name="lastName"
                        label="Last Name"
                        value={values.name_last}
                        onChange={handleInputChange}
                        error={errors.name_last}
                    />

                    <div>
                        <Controls.Button
                            type="submit"
                            text="Submit" />
                        <Controls.Button
                            text="Reset"
                            color="default"
                            onClick={resetForm} />
                    </div>
                </Grid>
                <Grid item xs={4}>
                    <Controls.DatePicker
                        name="dob"
                        label="Date of Birth"
                        value={values.dob}
                        onChange={handleInputChange}
                    />
                </Grid>
                <Grid item xs={4}></Grid>
                <Grid item xs={4}></Grid>
                <Grid item xs={4}>
                    <Controls.Input
                        name="phone1"
                        label="Primary Phone Number"
                        value={values.phone1}
                        onChange={handleInputChange}
                        error={errors.phone1}
                    />
                </Grid>
                <Grid item xs={4}>
                    <Controls.Select
                        name="phone1_type"
                        label="Type of phone"
                        value={values.phone1_type}
                        onChange={handleInputChange}
                        options={phoneTypes}
                        error={errors.phone1_type}
                    />

                </Grid>
                <Grid item xs={4}>
                    <Controls.RadioGroup
                        name="phone1_text_yn"
                        label="Are you willing to receive text messages at this number?"
                        value={values.phone1_text_yn}
                        onChange={handleInputChange}
                        items={binaryResponse}
                    />
                </Grid>
                <Grid item xs={4}>
                    <Controls.RadioGroup
                        name="phone2_yn"
                        label="Do you have a secondary phone number?"
                        value={values.phone2_yn}
                        onChange={handleInputChange}
                        items={binaryResponse}
                    />
                </Grid>
                <Grid item xs={4}></Grid>
                <Grid item xs={4}></Grid>
                <Grid item xs={4}>
                    <Controls.Input
                        name="phone2"
                        label="Secondary Phone Number"
                        value={values.phone2}
                        onChange={handleInputChange}
                        error={errors.phone2}
                    />
                </Grid>
                <Grid item xs={4}>
                    <Controls.Select
                        name="phone2_type"
                        label="Type of phone"
                        value={values.phone2_type}
                        onChange={handleInputChange}
                        options={phoneTypes}
                        error={errors.phone2_type}
                    />
                </Grid>
                <Grid item xs={4}>
                    <Controls.RadioGroup
                        name="phone2_text_yn"
                        label="Are you willing to receive text messages at this number?"
                        value={values.phone2_text_yn}
                        onChange={handleInputChange}
                        items={binaryResponse}
                    />
                </Grid>
                <Grid item xs={4}>

                    <Controls.Select
                        name="contact_besttime_survey"
                        label="When is the best time to contact you?"
                        value={values.contact_besttime_survey}
                        onChange={handleInputChange}
                        options={bestTime}
                        error={errors.contact_besttime_survey}
                    />
                </Grid>
                <Grid item xs={4}></Grid>
                <Grid item xs={4}></Grid>
                <Grid item xs={4}>
                    <Controls.Input
                        name="address1"
                        label="Address 1 (Building no. & Street name)"
                        value={values.address1}
                        onChange={handleInputChange}
                        error={errors.address1}
                    />
                </Grid>
                <Grid item xs={4}>
                    <Controls.Input
                        name="address2"
                        label="Address 2 (If applicable, Unit/Apt no.)"
                        value={values.address2}
                        onChange={handleInputChange}
                        error={errors.address2}
                    />
                </Grid>
                <Grid item xs={4}></Grid>
                <Grid item xs={4}>
                    <Controls.Input
                        name="city"
                        label="City"
                        value={values.city}
                        onChange={handleInputChange}
                        error={errors.city}
                    />
                </Grid>
                <Grid item xs={4}>
                    <Controls.Input
                        name="state"
                        label="State"
                        value={values.contact_besttime_survey}
                        onChange={handleInputChange}
                        error={errors.contact_besttime_survey}
                    />
                </Grid>
                <Grid item xs={4}>
                    <Controls.Input
                        name="contact_besttime_survey"
                        label="Zipcode"
                        value={values.contact_besttime_survey}
                        onChange={handleInputChange}
                        error={errors.contact_besttime_survey}
                    />
                </Grid>
            </Grid>
        </Form>
    )
}
